//making it easier to add diffrent constuctors of Birds
function Bird(name,species,gender,img,predator){
  this.name = name;
  this.species=species;
  this.gender=gender;
  this.img=img;
  this.predator = predator ? true : false;
}

var bird3 = new Bird("Raven","Crazy Bird", "male",'data:image/jpeg;base64,',true);
console.log(bird3);
//new constructors here,better than defining
var bird4 = new Bird("Egale","Bald","female",'data:image/jpeg;base64,');
var bird5 = new Bird("crow","scavenger","male",'data:image/jpeg;base64,');
var bird6 = new Bird("parrot","pirate","male",'data:image/jpeg;base64,');

console.log(bird4,bird5,bird6);

var birds = new Array();
birds.push(bird3,bird4,bird5,bird6);

var title = "Missoula Special birds"

console.log(birds);

var app = new Vue({
  el: "#app",
  data: {
    title: title,
    birds: birds,
    name:undefined,
    species:undefined,
    gender: undefined,
    img: undefined
  },
    methods: {
      addBird: function(){
        var newBird = new Bird(this.name,this.species,this.gender,this.img);
        birds.push(newBird);
        this.name = "";
        this.species= '';
        this.gender = '';
        this.img = '';
      }
    }
});
